MY HEART IS ON FIRE. ❤️‍🔥❤️‍🔥

I am SO PROUD to introduce @hotel.julie. A year and a half in the making, this project is finally out in the ether. 

I put everything into creating this hotel with an absolutely incredible team of collaborators by my side. 

Design:

Jilly @twenty.two.twelve - thank you for bringing so much creativity, out of the box thinking, technical expertise and a state of calm in the chaos haha! (Don’t panic, lol). 

@sarahbrinks—thank you for taking on such a massive role in this project- helping all our renders come to life and placing/tracking/managing hundreds of orders. Your positive spirit and attention to detail are incredible.

Marketing:

@abigailballanger—your vision is bar none. The Hotel Julie brand would not be what it is without your creative edge. You brought SO much to the project in so many areas. You really helped round out Hotel Julie from just a place to stay to a fully immersive brand. You have so many incredible ideas and I can’t thank you enough for bringing HJ to life in so many art forms from in-room printed collateral to a short film (like come on!). 

@daniellebarich—having your strategic brainpower on the project was worth its weight in gold. Thank you for your brilliance in crafting our brand personas, helping us write our beautiful tag line and of course—developing our signature scent. Adding in a sensory layer to my projects has been something I’ve wanted to do for a long time and I am so grateful to have your guidance in bringing the sensory journey to life.

@maradesignco- Jess! We threw so many curve balls and requests at you in an effort to create a beautiful brand and website. The website is so stunning and really tells the HJ story in digital context. 

& of course- thank you to our brilliant clients @tartan_developments for their trust in our vision and for such a life changing opportunity. 

Head to the @hotel.julie IG and tap the link in the bio to BOOK YOUR STAY!!! ❤️‍🔥❤️‍🔥❤️‍🔥

I didn’t realize you can’t post longer form videos on here haha! I wanted to post the full 5 minute conversation- but here’s a really juicy clip.

@cassdrake came over to give me some advice about hosting my first retreat and it snowballed into helping me uncover my new business direction. (Also shout out to Cass for her incredible questions and helping me dig deeper into my why.. THIS is the power of surrounding yourself with brilliant like minded people- If you need help with your biz— she does this for a living haha). 

In this conversation I passionately shared how I had been so profoundly impacted by doing these challenges that I had to come up with a way to build something of my own. To build community, to share what I’ve learned, to empower and teach others. This was before I came up with @designedbyether - I just had a strong inner knowing. And here we are. 🫶🏻
